import logo from './logo.svg';
import './App.css';
import styled from 'styled-components'
// import {BrowserRouter, Switch, Route,} from "react-router-dom";

function Menu() {
  return (
    <div>
     <br></br>
      <h1 style={{  
        display: "flex",
        justifyContent: "center",
        fontStyle: "Myriad Pro",
        fontWeight: "Semibold",
        fontSize: "50px",
        color: "#262626",
        margin: "0 auto"
        }}>
        Jesse Wray Lee Levanthol</h1>
      <ul style={{  
        display: "flex",
        justifyContent: "center",
        fontStyle: "Myriad Pro",
        fontSize: "20px",
        listStyleType: "none",
        color: "#262626",
        }}>
        <li>Illustration</li>
        <li>Design</li>
        <li>Video</li>
        <li>About</li>
      </ul>
    </div>

  );
}

const MenuLi = styled.li`
    font-size:30px;
    display: flex;
}`

export default Menu;
